import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

// ÏûÑÏãú Ïª¥Ìè¨ÎÑåÌä∏Îì§
const Dashboard = () => (
  <div className="p-8 bg-green-50 min-h-screen">
    <h1 className="text-3xl font-bold text-green-800 mb-6">üå± Greenflow Life Dashboard</h1>
    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
      <div className="bg-white p-6 rounded-lg shadow-md">
        <h2 className="text-xl font-semibold mb-4">Ïò§ÎäòÏùò ÌÉÑÏÜå Î∞úÏûêÍµ≠</h2>
        <p className="text-2xl text-green-600">2.3 kg CO‚ÇÇ</p>
      </div>
      <div className="bg-white p-6 rounded-lg shadow-md">
        <h2 className="text-xl font-semibold mb-4">Ï†àÏïΩÌïú ÌÉÑÏÜå</h2>
        <p className="text-2xl text-blue-600">1.2 kg CO‚ÇÇ</p>
      </div>
      <div className="bg-white p-6 rounded-lg shadow-md">
        <h2 className="text-xl font-semibold mb-4">Ïó∞ÏÜç Í∏∞Î°ù</h2>
        <p className="text-2xl text-orange-600">7Ïùº</p>
      </div>
    </div>

    <div className="mt-8">
      <h2 className="text-2xl font-bold mb-4">API ÌÖåÏä§Ìä∏</h2>
      <div className="bg-white p-4 rounded-lg shadow-md">
        <p className="mb-2">Î∞±ÏóîÎìú API: <span className="font-mono text-sm bg-gray-100 px-2 py-1 rounded">http://127.0.0.1:8001</span></p>
        <p className="mb-2">API Î¨∏ÏÑú: <a href="http://127.0.0.1:8001/docs" target="_blank" rel="noopener noreferrer" className="text-blue-500 hover:underline">http://127.0.0.1:8001/docs</a></p>
        <p className="text-sm text-gray-600">Î∏åÎùºÏö∞Ï†ÄÏóêÏÑú ÏúÑ ÎßÅÌÅ¨Î•º ÌÅ¥Î¶≠ÌïòÏó¨ APIÎ•º ÏßÅÏ†ë ÌÖåÏä§Ìä∏Ìï¥Î≥¥ÏÑ∏Ïöî!</p>
      </div>
    </div>
  </div>
);

const TestApi = () => {
  const [result, setResult] = React.useState<string>('');

  const testHealth = async () => {
    try {
      const response = await fetch('http://127.0.0.1:8001/health');
      const data = await response.json();
      setResult(JSON.stringify(data, null, 2));
    } catch (error) {
      setResult(`Error: ${error}`);
    }
  };

  return (
    <div className="p-8">
      <h1 className="text-2xl font-bold mb-4">API ÌÖåÏä§Ìä∏</h1>
      <button 
        onClick={testHealth}
        className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600"
      >
        Health Check ÌÖåÏä§Ìä∏
      </button>
      {result && (
        <pre className="mt-4 p-4 bg-gray-100 rounded overflow-auto">
          {result}
        </pre>
      )}
    </div>
  );
};

function App() {
  return (
    <Router>
      <div className="App">
        <nav className="bg-green-600 text-white p-4">
          <div className="container mx-auto flex items-center justify-between">
            <h1 className="text-xl font-bold">üå± Greenflow Life</h1>
            <div className="space-x-4">
              <a href="/" className="hover:underline">ÎåÄÏãúÎ≥¥Îìú</a>
              <a href="/test" className="hover:underline">API ÌÖåÏä§Ìä∏</a>
              <a href="http://127.0.0.1:8001/docs" target="_blank" rel="noopener noreferrer" className="hover:underline">API Î¨∏ÏÑú</a>
            </div>
          </div>
        </nav>

        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route path="/test" element={<TestApi />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
